import classes from "./MySelect.module.css"
import React from 'react';

const MySelect = () => {
    return (
        <div>
            <select>
                <option value="sortByName">Отсортировать по названию</option>
                <option value="sortByDescription">Отсортировать по описанию</option>
            </select>
        </div>
    );
};

export default MySelect;
